import React from 'react';
//
import {Route, Switch} from "react-router-dom";
//
import NavBar from "./Components/NavBar"
import HomePage from "./Pages/HomePage"
import './App.css';

function App() {
  return (
    <div className="App">
      <NavBar />

      {/* Route */}
      <Switch>
        <Route exact path="/" render={()=><HomePage />}/>
      </Switch>
    </div>
  );
}

export default App;
